import React from 'react';
import {BrowserRouter} from 'react-router-dom';
import Header from './header';
import Home from './home';
import Coin from './coin';
import './App.css'

export default function App() {

  return (
      <BrowserRouter>
        <div className="App">
          <Header />
          <Route path/>
          <Home />
          <Coin />
        </div>
      </BrowserRouter>
  )
}
